import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navigation.css'

import logo from '../../../assets/image/logo.svg'
import discover from '../../../assets/images/discover.svg';
import library from '../../../assets/images/library.svg';
import profile from '../../../assets/images/profile.svg'

import Input from '../Input/Input';


const Navigation = () => (
  <div className="navigation">
    <div className="navigation_item">
      <NavLink activeClassName="active" exact to='/'><img src={discover} alt="" /><span>Discover</span></NavLink>
      <NavLink activeClassName="active" to='/library'><img src={library} alt="" /><span>library</span></NavLink>
    </div>
    <div>
      <NavLink activeClassName="active" exact to='/'><img src={logo} alt="" /></NavLink>
    </div>
    <div className="navigation_item">
      <img src={profile} alt="" />
      <Input elementType="search" />
    </div>
  </div>
);

export default Navigation;
